import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import NavBar  from './App.js';

let cars = ["bmw", "mercedes", "tesla", "toyata"];
const displayCar = cars.map((car) => (
  <li>{car}</li>
))
const HelloCar = () => (<h1>i am a person</h1>)

const NameCar2 = () =>   (
  <>
  <HelloCar />
  <NavBar />
  {displayCar}
  {display}
  {heading}
  <h1>hello world</h1>
  </>
)

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <NameCar2 />



);

const display = cars.map((car) => {
  return <li>{car}</li>
})

const heading = (
  <>
  <h1>pratik is a network engineer</h1>
  <h3>pratik works for zimble</h3>
  <h5>pratik will pay my next week rent</h5>
  </>
)
const time = (
  <>
  <h1>{new Date().getDay()}</h1>
  </>
)
setInterval(time,1000)
